import React from "react";
import Card from "../UI/Card/Card";
import "./CSS/UserInput.module.css";

const UserInput = (props) => {
  return (
    <Card>
      <form>
        <div>
          <label>Username</label>
          <input type="text" />
        </div>
        <div>
          <label>Age</label>
          <input type="text" />
        </div>
      </form>
    </Card>
  );
};
export default UserInput;
